pragma solidity >=0.4.22 <0.9.0;

contract TodoList{

    uint public taskCount=0;
    struct Task{
        string content;
        uint time;
        uint priority;
        bool completed;
    }
    mapping(uint=>Task) public tasks;

    constructor() public{
        createTask("Test todo", block.timestamp);
    }

    function createTask(string memory _content,uint time) public{
        taskCount++;
        tasks[taskCount]=Task(_content,block.timestamp,block.timestamp-time,false);
    }

    function deleteTask(uint id) public{
        delete tasks[id];
        taskCount--;
    }
}
